    [TestClass]
    public class UnmarshalTests
    {
        private string hexPacket =
                @"";
        private string hexPacketTerminalDestruction = @"";
        [TestMethod]
        public void TestMethod1()
        {
            byte[] byteArray = Enumerable.Range(0, hexPacketTerminalDestruction.Length / 2)
                .Select(i => Convert.ToByte(hexPacketTerminalDestruction.Substring(i * 2, 2), 16))
                .ToArray();

            var unmarshal = new Unmarshal();
            //unmarshal.DebugMode = true;
            PyRep.EnableInspection = true;
            var t = unmarshal.Process(byteArray, null);
            var prettyP = new PrettyPrinter();
            //9002037360000012494
            Assert.IsTrue(t.GetDestructedEntityIds().Contains(9002037360000012494));
        }


