        [TestMethod]
        public void TestMethod3()
        {
            byte[] byteArray = Enumerable.Range(0, hexPacket.Length / 2)
                .Select(i => Convert.ToByte(hexPacket.Substring(i * 2, 2), 16))
                .ToArray();

            var unmarshal = new Unmarshal();
            //unmarshal.DebugMode = true;
            PyRep.EnableInspection = true;
            var t = unmarshal.Process(byteArray, null);
            var prettyP = new PrettyPrinter();

            var pyIntegrVars = t.Descendents().Where(d => d is PyIntegerVar).ToList();

            foreach (var intvar in pyIntegrVars)
            {
                if (intvar.IntValue == 9002037144000009221)
                    foreach (var parent in intvar.Parents)
                    {
                        Debug.WriteLine(prettyP.Print(parent));
                    }
            }
        }
